import React from 'react';

//const KEY = 'AIzaSyBdXjGbMZ7Yd_W3digAhPLAjnKWACgL5Us';

class Search extends React.Component{
    constructor(){
        super()
        this.state = {
            value: '',
        }
    }

    handleChange = (e) => {
        this.setState({value: e.target.value});
    }

    render(){
        return(
            <div>
                <input type='text' name='search' placeholder='Search here' value={this.state.value} onChange={this.handleChange} />

            </div>
        )
    }

}

export default Search;
